import React from 'react';
import { NavLink } from 'react-router-dom';
const Contact=()=>{
   
    return(

        <>
            <div className="setStyle2">
                <h1>Contact Page.....</h1>
                <form>
                    <label>Name : </label><input className="iN" type="text" placeholder="Enter Your Name" />
                    <label>Mobile Number : </label><input className="iN" type="number" placeholder="Enter Your Mobile Number" />

                </form><br />
                <NavLink to="/">Go Back</NavLink>
             
                
            </div>
        </>
    )
}
export default Contact;
